import React from "react";
import { useNavigate } from 'react-router-dom';
const Button = (props) => {
    const navigate = useNavigate();
    const buttonName = props.data.name
    const playPage = () => {
        navigate('/play')
    }
    return (
        <div>
            {
                buttonName === "Play Now" &&
                <button className="btn btn-lg btn-success" type="button" onClick={playPage}>
                    {buttonName}
                </button>
            }
            {
                buttonName !== "Play Now" &&
                <button className="btn btn-lg btn-success" type="button" >
                    {buttonName}
                </button>
            }
        </div>
    )
}
export default Button
